import React from 'react';
import { Box, Heading } from 'grommet';

const landing = props => {
  return (
    <React.Fragment>
      <Box height="100%" justify="center" align="center" animation="fadeIn">
        <Heading 
          color="dark-1" 
          margin="none"
          size="small" 
        >
          Where to eat in
        </Heading>
        <Heading 
          color="status-warning" 
          margin="none"
          size="large" 
        >
          {props.location}
        </Heading>
      </Box>
    </React.Fragment>
  )
}

export default landing;
